import React from "react";
import "./SchoolList.css";
import EngineeringIcon from "@mui/icons-material/Engineering";
const SchoolList = () => {
  return (
    <div className="school">
      <div className="featuredItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
          <div className="domain_image">
            <EngineeringIcon />
          </div>
          <h3 className="schoolName">IIT Bombay</h3>
        </div>
      </div>
      {/* item2 */}
      <div className="featuredItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
          <h3 className="schoolName">IIT Bombay</h3>
        </div>
      </div>
      {/* item3 */}
      <div className="featuredItem">
        <div className="card">
          {/* <img
            src="https://imgk.timesnownews.com/story/IIT_Delhi_6.jpg"
            className="schoolImg"
            alt="College"
          /> */}
          <h3 className="schoolName">IIT Bombay</h3>
        </div>
      </div>
    </div>
  );
};

export default SchoolList;
